import React from "react";
export default function Player(props) {
  return (
    <article className="playerProfile">
      <div className="img-Container">
        <img
          className="main_image"
          src={props[0].img.src}
          alt={props[0].img.alt}
        />
        <button>{props[0].title}</button>
      </div>
    </article>
  );
}
